import React from 'react';
import './catalogo.css';
import { Row, Col, Button, Input, FormGroup } from 'reactstrap';

function Catalogo() {
    return (
      <div>
          <Row>
            <Col md='2'>
                <a className="bgfime" href="/detalhes/tt1361296">
                    <Col md='12'>
                        <img className="poster" src="./Imagens/n-a.jpg" alt="poster"/>
                    </Col>
                    <div class="poster-text">
                        <h3>Episode dated 3 December 1992</h3>
                        <p>N/A</p>
                        <FormGroup>
                            <small id="notaFilme">Nota: N/A</small>
                            <small id="tempoFilme">120 min</small>
                        </FormGroup>
                    </div>
                </a>
            </Col>
          </Row>      
      </div>            
    );
  }
  
  export default Catalogo;
